import 'dart:convert';
import 'dart:typed_data';

import 'dart:ui';

import 'package:umbra_flutter/umbra_flutter.dart';

/// {@template character_outline}
/// A Dart Shader class for the `character_outline` shader.
/// {@endtemplate}
class CharacterOutline extends UmbraShader {
  CharacterOutline._() : super(_cachedProgram!);

  /// {@macro character_outline}
  static Future<CharacterOutline> compile() async {
    try {
      // Caching the program on the first compile call.
      _cachedProgram ??= await FragmentProgram.compile(
        spirv: Uint8List.fromList(base64Decode(_spirv)).buffer,
      );

      return CharacterOutline._();
    } on Exception catch (err, stackTrace) {
      throw UmbraException(err, stackTrace);
    }
  }

  static FragmentProgram? _cachedProgram;

  Shader shader({
    required Size resolution,
    required Vector2 imageResolution,
    required double lineThickness,
    required Vector4 lineColor,
    required Image image,
    required double uTime,
  }) {
    return program.shader(
      floatUniforms: Float32List.fromList([
        imageResolution.x,
        imageResolution.y,
        lineThickness,
        lineColor.x,
        lineColor.y,
        lineColor.z,
        lineColor.w,
        uTime,
        resolution.width,
        resolution.height,
      ]),
      samplerUniforms: [
        ImageShader(
          image,
          TileMode.clamp,
          TileMode.clamp,
          UmbraShader.identity,
        ),
      ],
    );
  }
}

const _spirv =
    '';
